INSERT INTO `chatbot_chathistory` VALUES (1,'how to login','You can login by clicking the \'Login\' button in the top right corner and entering your credentials.','2025-05-20 10:42:59.381909',1),(2,'how to login','You can login by clicking the \'Login\' button in the top right corner and entering your credentials.','2025-05-20 10:48:42.321283',1),(3,'login','I\'m sorry, I can only answer questions about this project\'s functionality. Please ask about how to use this application.','2025-05-20 10:52:19.016684',1),(4,'manuscripts','I can only answer questions about this manuscript submission system. Please ask about specific workflows or roles.','2025-05-20 10:54:44.705717',1),(5,'editor in chief','EIC makes final decisions on manuscripts.','2025-05-20 10:54:59.549885',1),(6,'assosiate editor','I can answer about author, admin, associate editor, reviewer, or editor-in-chief workflows. Please specify a role and question.','2025-05-20 11:02:14.779674',1),(7,'associate editor','AE manages review process and makes recommendations.','2025-05-20 11:02:30.953627',1),(8,'complete folow','I can answer about author, admin, associate editor, reviewer, or editor-in-chief workflows. Please specify a role and question.','2025-05-20 11:02:44.527864',1),(9,'associate editor','AE manages review process and makes recommendations.','2025-05-20 11:03:09.262529',1),(10,'associate editor complete flow','\n        ASSOCIATE EDITOR COMPLETE WORKFLOW:\n        \n        1. Manuscripts to Review:\n           - \'Invite\' reviewers\n           - \'Reject\' manuscript\n           - View plagiarism report\n        \n        2. Manuscripts with Review Reports:\n           - View reviewer comments\n           - Contact reviewers\n           - \'Recommend\' manuscript\n        \n        3. Manuscripts Under Review:\n           - View assigned reviewers\' progress\n        \n        4. Manuscripts to EIC:\n           - After recommendation  Goes to Editor-in-Chief\n        ','2025-05-20 11:03:44.20963