sions/merged_submission_59.pdf',NULL,NULL,NULL,5,3,1,2,NULL,NULL,3,NULL,NULL,NULL,NULL,'','','submissions/crm.pdf',1),(60,'A Comparative Study of Machine Learning Algorithms','JCS-2025-06-2','A Comparative Study of Machine Learning Algorithms',0,NULL,NULL,NULL,0,0,0,0,0,'',0,'cover','2025-06-18','2025-06-19',1,'submissions/merged_submission_60_i070Vp3.pdf','AE Comments:\r\nReviewers Comments:\r\n\r\n\r\n\r\nThe paper presents a well-structured and novel approach to solving the stated problem using AI techniques. The methodology is sound, and the experimental results support the claims effectively.','2025-06-19','2025-06-26',13,3,1,2,1,21,2,NULL,'2025-07-02',NULL,'2025-06-27','submissions/sample_yMGCvSS_B2m6xbi.docx','','submissions/crm.pdf',1),(62,'jhvgb','JCM-2025-06-1','Anemia is a major burden on global health, and its various subtypes must be appropriately identified in order to allow for effectiveclinical interventions. Although anemia detection has been enhanced by recent machine learning (ML) approaches, most models cast it as a binaryclassification problem and categorize if a patient is anemic without any information about the kind. In this paper, we propose a real-time two-stage multi-class anemia subtype diagnosis frameworknamed HemoType-Net++ with an integrated XGBoost learning model and a medical rule-based refinement layer. The model takes as input standard CBC parameters and endpoints results into clinically relevantclassifications, including iron deficiency anemia, normocytic anemia, and megaloblastic anemia. Following prediction, expert-driven logic is added at MCV, MCH, and MCHC thresholds to consolidate and increase sensitivity without dependenceon black-box explainable tools. The proposed framework is integrated into an interactive Gradio interface and allows for real-time feedback and seamless user interaction. HemoType-Net++ has been tested on an independent CBC dataset of 1,281 patient samples (obtained from Kaggle) with multi-class classification accuracy of 94.7%, demonstrating the predictive ability and alignment with clinical intuition of the proposedsolution. Becauseof its edge-device compatibility and lightweight nature, it is apt for institutions as well as field use. The modular design facilitates future expansions, such as combining with other lab tests, enlarging multi-center datasets, and ensemble model comparison forbetter clinical reliability.',NULL,NULL,NULL,NULL,NULL,0,0,0,NULL,NULL,0,NULL,'2025-06-24','2025-06-24',0,'',NULL,NULL,NULL,20,3,14,2,NULL,NULL,2,NULL,NULL,NULL,NULL,'','','',1),(63,'The Influence of Social Media on Adolescent Mental Health: A Meta-Analysis','JECE-2025-07-1','The Influence of Social Media on Adolescent Mental Health: A Meta-Analysis',0,NULL,NULL,NULL,0,0,0,0,0,'',0,'The Influence of Social Media on Adolescent Mental Health: A Meta-Analysis','2025-07-10','2025-07-10',0,'submissions/merged_submission_63.pdf',NULL,NULL,NULL,21,3,1,1,NULL,NULL,1,NULL,NULL,NULL,NULL,'','','',1),(64,'Sustainable Agriculture Practices and Their Effects on Soil Health','JCS-2025-07-1','Sustainable Agriculture Practices and Their Effects on Soil Health',0,NULL,NULL,NULL,0,0,0,0,0,'',0,'Sustainable Agriculture Practices and Their Effects on Soil Health','2025-07-10','2025-07-10',0,'submissions/merged_submission_64.pdf',NULL,NULL,NULL,3,3,1,2,NULL,7,2,NULL,NULL,NULL,NULL,'','','submissions/sample_CBpxrgf.pdf',3);
